import React,{useState} from "react";
import UserContext from "./UserContext";

const UserProvider=(props)=>{
    const [token,setToken]=useState("");
    return(
         <UserContext.Provider value={{
            token:token,
            setToken:setToken

         }}>
              {props.children}
</UserContext.Provider>
)
}

export default UserProvider;
